var $ = jQuery.noConflict();

function render_gambar() {
    $.ajax({
        type: "GET",
        url: rootWebService + "Manager/RenderProfil",
        async: true,
        dataType: "json",
        success: function(response) {
            var hasil = response.hasil;
            $("#side-profil").html(hasil);
        },
    });
}

